<script setup>
import { ref, onMounted, watch, computed } from "vue";

let currentImage = ref(null);
let currentImageIndex = ref(0);
let initialPlay = ref(false);
let isPlaying = ref(false);
let timing = ref(0);

let play = () => {
  initialPlay.value = isPlaying.value = true;

  if (currentImageIndex.value >= images.length - 1) {
    currentImageIndex.value = 0;
    timing.value = 0;
  }
  let i = 0;
  let callback = () => {
    currentImageIndex.value++;

    i++;
    if (i >= images.length - 1) return;

    setTimeout(callback, images[i].timing);
  };

  // while (timing.value < images[i].timing) {
  //   setTimeout(() => {
  //     timing.value += 1;
  //   }, 100)
  // }

  setTimeout(callback, images[i].timing);
};

let currentTiming = computed(() => {
  return timing.value / 1000;
});

let pause = () => {
  isPlaying.value = false;
};

let previous = () => {
  if (!initialPlay.value) {
    return;
  }

  if (currentImageIndex.value === 0) {
    return;
  }

  currentImageIndex.value--;
};

watch(currentImageIndex, async (newIndex, oldIndex) => {
  currentImage.value = images[currentImageIndex.value];
});

let next = () => {
  if (!initialPlay.value) {
    return;
  }

  if (currentImageIndex.value === images.length - 1) {
    return;
  }

  currentImageIndex.value++;
};

const getCurrentImage = computed(() => {
  if (null === currentImage) {
    return "";
  }

  return currentImage.value?.data;
});

let totalTiming = () => {
  return images.reduce(
    (accumulator, currentValue) => accumulator + currentValue.timing,
    0
  );
};

